import React from 'react';
import './navbar.css'
import {links} from './navbarlinks'
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
function Sidebar() {
  return <div className='Sidebar'>
    <div id='links'>
    {links.map((link) => {
      return (
        <a id='link2' href={link.url} key={link.id}>{link.text}</a>
      )
    })}
    <LinkedInIcon href='https://www.linkedin.com/in/navid-c/' style={{ fontSize: 40 }} id='profiles' />
    <GitHubIcon style={{ fontSize: 40 }} id='profiles'/>
    <Button id='profiles'
        variant="link"
        color="default"
        className={classes.signInButton}
        startIcon={<MailOutlineIcon />}
        href="https://www.linkedin.com/in/navid-c/"
      />
    </div>
    
    
  </div>
}

export default Sidebar;
